  input: '"TEXT","F3XA","","Dear Mr. Decker,This letter is in response to your preliminary
    review of the Unite Our States Year-End Report for 2005.  Schedule B of this report
    discloses one or more contributions which appeared to exceed the limits of $2100
    per election per candidate for contributions for candidate for federal office.
    In this amendment, the Committee will provide clarifying information to disclose
    the proper designations of each of the contributions in question; thus allowing
    for no more than $2100 per election per candidate.     The expenditures on Schedule
    B including ''Banner and Posters for Event,'' ''Catering Expense,'' ''Expense
    Reimbursement-Catering,'' ''Fundraising Consulting Fees,'' ''Reimbursement for
    wine for fundraiser,'' ''Venue Rental-Deposit for Rental,'' were not made on behalf
    of federal candidates. In fact, these expenditures were all made for the express
    use and needs of the Committee itself. Furthermore, the expenditures on Schedule
    B including ''communications consulting'' and ''Expense Reimbursement-Advertising''
    were not used for public communications or voter drive activity. This activity
    did not contain express advocacy, and the expenditures in question were for the
    Committee?s purposes and thus the report has not been amended in regards to these
    expenditures.  Finally, please note that a contribution previously and mistakenly
    recorded as a PAC contribution was actually found to be from a partnership, and
    this amendment reflects this adjustment as well. Thank you in advance for your
    consideration.  ",""'
